import React, { Component } from "react";

export default class Bio extends Component {
  render() {
    return (
      <div className="bio-container">
        <span className="gothic">
          <h1>About Me:</h1>
          <div className="bio-item">
              This is my bio
          </div>
        </span>
      </div>
    );
  }
}
